from tabulate import tabulate
import numpy as np
class_names = target_names
# Create the Confusion Matrix
num_classes = 4
num_samples = len(clasepredita)
truth_table = np.zeros((num_classes, num_classes + 1), dtype=int)  # Add an additional column for "unknown" predicted class

# Loop through each sample and update the Confusion Matrix
for i in range(num_samples):
    if clasepredita[i] != 5:
        truth_table[claseactual[i] - 1][clasepredita[i] - 1] += 1
    else:
        truth_table[claseactual[i] - 1][num_classes] += 1  # Update the count in the additional column for "unknown" predicted class

# Create header labels for the Confusion Matrix
header = ['Actual/Predicted'] + class_names + ['Unknown']

# Convert the Confusion Matrix to a list of lists for tabulate, with class names instead of numbers in the first column
table_data = [[class_names[i]] + truth_table[i].tolist() for i in range(num_classes)]

# Print the Confusion Matrix using tabulate
print("Confusion Matrix:")
print(tabulate(table_data, headers=header, tablefmt="grid"))

# Convert to confusion matrix
conf_matrix = np.array([row[1:-1] for row in table_data])

# Calculate accuracy
accuracy = np.trace(conf_matrix) / np.sum(conf_matrix)

print(f"Accuracy: {accuracy:.2f}")

print(conf_matrix)

# Calculate precision and recall
macro_precision, macro_recall, macro_f1 = 0, 0, 0
for i in range(len(conf_matrix)):
    tp = conf_matrix[i, i]
    fp = np.sum(conf_matrix[:, i]) - tp
    fn = np.sum(conf_matrix[i, :]) - tp
    tn = np.sum(conf_matrix) - tp - fp - fn
    precision = tp / (tp + fp) if (tp + fp) != 0 else 0
    recall = tp / (tp + fn) if (tp + fn) != 0 else 0
    f1 = 2 * precision * recall / (precision + recall) if (precision + recall) != 0 else 0
    macro_precision += precision
    macro_recall += recall
    macro_f1 += f1
    print(f"Class {i+1}: Precision = {precision:.2f}, Recall = {recall:.2f}, F1-score = {f1:.2f}")

n = len(conf_matrix)
macro_precision /= n
macro_recall /= n
macro_f1 /= n
micro_precision = np.sum(np.diag(conf_matrix)) / np.sum(conf_matrix)
micro_recall = np.sum(np.diag(conf_matrix)) / np.sum(conf_matrix, axis=0).sum()
micro_f1 = 2 * micro_precision * micro_recall / (micro_precision + micro_recall)

print(f"Macro Precision: {macro_precision:.2f}, Macro Recall: {macro_recall:.2f}, Macro F1-score: {macro_f1:.2f}")
print(f"Micro Precision: {micro_precision:.2f}, Micro Recall: {micro_recall:.2f}, Micro F1-score: {micro_f1:.2f}")